import Img from '..'

export default function Header(props) {
    return (
        <header>
            <nav className="teal lighten-1">
                <div className="nav-wrapper container">
                    <h href="%PUBLIC_URL%/logo192.png" className="brand-logo"></h>
                </div>
            </nav>
        </header>
    );
}
